import React from "react";
import Button from "../../Button";

const gallery = () => {
  return (
    <div className="justify-content-center" style={{ textAlign: "center" }}>
      <div>
        <Button title="Living rooms" />
      </div>
      <div>Modern</div>
    </div>
  );
};

export default gallery;
